  width: $cw;
  height: $cw;
  position: relative;
}
.select-hours,
.select-minutes {
  width: $cw;
  height: $cw;
  padding: 0px;
  position: relative;
}

.line {
  width: $bw;
  background-color: rgba(220, 220, 220, 0.769);
  height: calc($cw * 0.5);
  position: absolute;
  top: 0px;
  left: calc(($cw * 0.5) - ($bw * 0.5));
  display: flex;
  justify-content: flex-end;
  overflow: visible;
  border-radius: 100%;
  user-select: none;
  cursor: pointer;
}
.line:hover {
  background-color: rgb(124, 124, 124);
  z-index: 1;
}
.line:hover button {
  border: 3px solid rgba(0, 0, 0, 0.474);
  transition: box-shadow ease-in-out 400ms;
}

@for $i from 0 through 59 {
  @keyframes a-#{$i} {
    0% {
      transform: rotate(0deg);
      height: 0px;
      top: calc($cw * 0.5);
    }
    100% {
      transform: rotate(#{$i * 30}deg);
      height: calc($cw * 0.5);
      top: 0px;
    }
  }

  .line:nth-child(#{$i + 1}) {
    transform: rotate(#{$i * 30}deg);
    transform-origin: bottom;
    animation: a-#{$i} 3000ms cubic-bezier(0.165, 0.84, 0.44, 1) 0ms;
    button {
      transform: rotate(-#{$i * 30}deg);
    }
  }
}

.time-value {
  position: absolute;
  margin: auto;
  top: calc($cw * 0.5 - ($bw * 1.5) * 0.5);
  left: calc($cw * 0.5 - ($bw * 1.5) * 0.5);
  z-index: 2;
  background-color: gray;
  color: white;
  font-size: calc($bw * 0.7);
  width: calc($bw * 1.5);
  height: calc($bw * 1.5);
  border-radius: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  font-weight: bolder;

  text-align: center;
  outline: none;
  border: none;

  animation: flover 1000ms linear 0ms infinite;
}

